import React from "react";
import { useLocation, useParams } from "react-router-dom";

const User = () => {
  const { fname, lname } = useParams();
  const location = useLocation();
  console.log(location);

  return (
    <h1>
      User {fname} {lname} Page
    </h1>
    
  );
};

export default User;
